if (!window.SwitlishConfig) {

    window.SwitlishConfig = {	
        switlish_widget_version: "@latest",
        switlish_key_client: "extension",
        switlish_client_name_list: "A trier",
        switlish_pop_out_on_mouse_out: false,
        switlish_text_color: "03224c",
        switlish_text_font: "Raleway",
        switlish_background_color: "ffd531"
    };
}

var SWITLISH_PACKAGE_VERSION = window.SwitlishConfig.switlish_widget_version;

(function(d, s, id) { 
if (d.getElementById(id)) {return;};
var sc = d.createElement(s);
var sj = d.getElementsByTagName(s)[0];
sc.id = id;sc.async = true;
sc.src =`//cdn.jsdelivr.net/npm/switlish-plugin-put-aside${SWITLISH_PACKAGE_VERSION}/switlish_widget.min.js`; 
sj.parentNode.insertBefore(sc, sj);
})(document, 'script', 'switlish-widget-all-id');